import React from "react";
import { Link } from "react-router-dom";
import SideBar from "./SideBar";
import Themebtn from "./Themebtn";
import { useState } from "react";

const NavBar = () => {
  const [darkMode, setDarkMode] = useState(false);

  const changeMode = () => {
    setDarkMode(!darkMode);
  };
  return (
    <nav class="bg-blue-100 flex gap-20">
      <div>
        <SideBar />
      </div>

      <div className="z-50 pt-2 bg-blue-500 ml-50">
        <Link to={"/"}>
          <h1 class="text-4xl ">
            <span className="pr-4">SR</span>
            <i class="fa-solid fa-code"></i>
          </h1>
        </Link>
      </div>
      <div>
        <div className={`${darkMode && "dark"}`}>
          <button
            className="absolute w-8 h-8 mt-2 text-white rounded-full right-16 bg-neutral-600 dark:bg-white dark:text-black"
            onClick={changeMode}
          >
            <i
              class={
                darkMode ? `${"fa-solid fa-sun"}` : `${"fa-solid fa-moon"}`
              }
            ></i>
          </button>
        </div>
      </div>
    </nav>
  );
};

export default NavBar;
